import React from "react";
import { v4 as uuidv4 } from "uuid";
import TimelineItem from "./TimelineItem";

const JOBS = [
  {
    from: "2018",
    to: "2022",
    company: "24metrics",
    company_url: "https:24metrics.com",
    title: "Software Engineer",
    tasks: [
      "Lead Engineer for one of the main projects of the company, Maintaining and releasing new features for a Laravel aplication, AngularJS frontend, MySQL, ElasticSearch, Redis, RabbitMQ, CircleCI, with everything deployed initially in AWS and later in GCP",
      "Implementing various tools and micro-services using Go",
      "Technical Support",
    ],
  },
];

export default function Timeline() {
  return (
    <div className="timeline clearfix">
      {Jobs.map((job) => (
        <TimelineItem key={uuidv4()} job />
      ))}
      <TimelineItem />
    </div>
  );
}
